    "2015-08-21T22:38:55.136770",nt"name": "foreign-medical-program-fmp",nt"isopen":
    true,nt"url": null,nt"notes": "The Foreign Medical Program (FMP) is a health
    care benefits program designed for US Veterans with Veterans Affairs-rated service-connected
    conditions that are residing or traveling abroad (Canada and Philippines excluded).
    Under FMP, VA assumes payment responsibility for certain necessary medical services
    associated with the treatment of these service-connected conditions. The FMP database
    stores necessary information about Veterans eligible for foreign payment or reimbursement.
    Included is information about the services used and expenses incurred. FMP shares
    files with CHAMPVA (Civilian Health and Medical Program of VA) Eligibility & Payment
    Functions (CVA), and resides on the same server at the Health Administration Center
    (HAC) at Denver, Colorado. The HAC is a division of the Veterans Health Administration
    (VHA) Chief Business Office.",nt"license_title": "Creative Commons CCZero",nt"extras":
